import React from 'react';

const CurriculumVitae = ({ setShowCV }) => {
  return (
    <div className="fixed inset-0 bg-gray-600 bg-opacity-50 overflow-y-auto h-full w-full">
      <div className="relative top-20 mx-auto p-5 border w-11/12 md:w-3/4 lg:w-1/2 shadow-lg rounded-md bg-white">
        <div className="mt-3 text-center">
          <h3 className="text-lg leading-6 font-medium text-gray-900">Curriculum Vitae</h3>
          <div className="mt-2 px-7 py-3">
            {/* CV content goes here */}
            <p>This is where you would put the detailed CV information.</p>
          </div>
          <div className="items-center px-4 py-3">
            <button
              onClick={() => setShowCV(false)}
              className="px-4 py-2 bg-purple-600 text-white text-base font-medium rounded-md shadow-sm hover:bg-purple-700 focus:outline-none focus:ring-2 focus:ring-purple-300"
            >
              Close
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CurriculumVitae;
